import "./TradeItem.css";

function TradeItem() {
  return (
    <div className="trade-item">
      <div className="trade-item-date">March 29th 2023</div>
      <div>
        <h2 className="trade-item-description">Ticker</h2>
        <div className="trade-item-pnl">PnL %</div>
        <div className="trade-item-pnl">PnL Amount</div>
      </div>
    </div>
  );
}

export default TradeItem;
